import {TouchableOpacity, StyleSheet, Text, View } from 'react-native'
import React, { useState } from 'react'

export default function AdminArea({navigation}) {
  const [id, setId] = useState("");
  const [name, setName] = useState("");
  const [pic, setPic] = useState("");
  const [link, setLink] = useState("");
  const [date, setDate] = useState("");
  const [price, setPrice] = useState("");
  const [available, setAvailable] = useState("");
  const [error, setError] = useState("");

  return (
    <View style={styles.container}>
      
      <TouchableOpacity style={styles.buttonstyle} onPress={() => { navigation.navigate('EditFootBallStadium') }}>
        <Text style={styles.buttontext}>Click for edit Football Stadiums</Text>
      </TouchableOpacity>

      <TouchableOpacity style={styles.buttonstyle} onPress={() => { navigation.navigate('EditBasketBallStadium') }}>
        <Text style={styles.buttontext}>Click for edit Basketball Stadiums</Text>
      </TouchableOpacity>

      <TouchableOpacity style={styles.buttonstyle} onPress={() => { navigation.navigate('EditTennisStadium') }}>
        <Text style={styles.buttontext}>Click for edit Tennis Stadiums</Text>
      </TouchableOpacity>
      
    </View>
  )
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#FFF",
    padding: 60,
    alignItems: "center",
    justifyContent: 'center'
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    paddingBottom: 10,
    
  },
  buttonstyle: {
    backgroundColor: '#022b3a',
    width: '100%',
    height: 80,
    marginBottom: 50,
    borderRadius: 10,
    alignItems: 'center',
    justifyContent: 'center'
  },
  buttontext: {
    color: 'rgb(255, 255, 255)',
    fontWeight: '700',
    fontSize: 16,
  },
})
